I’ve always showed up for the people in my life, and I’ve always trusted people that have let me down in some way or the other, I’ve learned not to blame them, People will only do what you allow them to do, it’s in their nature. 
if you accept it the first time, you’re literally setting the stage for them to continue that behavior, it’s not what they did to you, it’s what you allowed them to do, 
Although it would be nice, I don’t expect anyone to show up for me anymore, life can be a series of lessons that help us appreciate the blessings. #sundaymotivation knowingishalfthebattle  #sheadiamond #wordstoliveby #wordsofwisdom #believeit #wisdomquotes #whenpeopleshowyouwhotheyarebelievethem #remember

